configure_settings(){
   if [ -f ${SETTINGS_SAVE} ]; then
      echo '################################'
      echo 'RESTORE SETTINGS'
      echo '################################'
   else
      echo '################################'
      echo 'CONFIGURE SETTINGS'
      echo '################################'
   fi

   rtcm_msg="1005(10),1033(10),1077,1087,1097,1107,1117,1127,1137,1230"
   rtcm_msg_onocoy="1005(30),1033(30),1077,1087,1097,1107,1117,1127,1137,1230(30)"
   rtcm_msg_full="1005,1006,1007,1013,1033,1019,1020,1042,1044,1045,1046,1048,1077,1087,1097,1107,1117,1127,1137,1230"
   sed="sudo -u ${RTKBASE_USER} sed -i"
   #echo sed=${sed}

   POINTED_VERSION=`echo ${NEW_VERSION} | sed 's/^\(.\)\(.\)\(.\)/\1.\2.\3/'`
   #echo POINTED_VERSION=${POINTED_VERSION}
   ${sed} s/^elt_version=.*/elt_version=${POINTED_VERSION}/ "${SETTINGS_DEFAULT}"

   if [ -f ${SETTINGS_SAVE} ]; then
      #echo sudo -u "${RTKBASE_USER}" mv ${SETTINGS_SAVE} ${SETTINGS_NOW}
      sudo -u "${RTKBASE_USER}" mv ${SETTINGS_SAVE} ${SETTINGS_NOW}
      ExitCodeCheck $?

      if [[ ${OLD_VERSION} < 172 ]]; then
         source <( grep -v '^#' "${settings}" | grep 'rtcm_msg_a=' )
         #echo rtcm_msg_a=${rtcm_msg_a}
         if [[ "${rtcm_msg_a}" == "${rtcm_msg}" ]]; then
            echo correct \"rtcm_msg_a\" field for version below 172
            ${sed} s/^rtcm_msg_a=.*/rtcm_msg_a=\'${rtcm_msg_onocoy}\'/ "${SETTINGS_NOW}"
         fi
      fi

      source <( grep -v '^#' "${SETTINGS_DEFAULT}" | grep 'version=' )
      #echo version=${version}
      ${sed} s/^version=.*/version=${version}/ "${SETTINGS_NOW}"

      #echo if grep -q \"^elt_version=\" \"${SETTINGS_NOW}\"\; then
      if grep -q "^elt_version=" "${SETTINGS_NOW}"; then
         #echo ${sed} \"s/^elt_version=.*/elt_version=${NEW_VERSION}/\" \"${SETTINGS_NOW}\"
         ${sed} "s/^elt_version=.*/elt_version=${POINTED_VERSION}/" "${SETTINGS_NOW}"
      else
         echo insert elt_version into ${SETTINGS_NOW}
         #echo ${sed} "\"/^version=/a # ELT Version\\nelt_version=${NEW_VERSION}\"" \"${SETTINGS_NOW}\"
         ${sed} "/^version=/a # ELT Version\nelt_version=${POINTED_VERSION}" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^cast2=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^cast2=" "${SETTINGS_NOW}"; then
         echo insert cast2 into ${SETTINGS_NOW}
         #echo ${sed} "\"/^cast=/a cast2=/usr/local/bin/ntripserver\"" \"${SETTINGS_NOW}\"
         ${sed} "/^cast=/a cast2=/usr/local/bin/ntripserver" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^svr_mode_a=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^svr_mode_a=" "${SETTINGS_NOW}"; then
         echo insert svr_mode_a and svr_login_a into ${SETTINGS_NOW}
         #echo ${sed} "\"/^svr_port_a=/a #ntrip A caster mode]\\nsvr_mode_a=\'0\'\\n#ntrip A caster login\\nsvr_login_a=\'\'\"" \"${SETTINGS_NOW}\"
         ${sed} "/^svr_port_a=/a #ntrip A caster mode\nsvr_mode_a=\'0\'\n#ntrip A caster login\nsvr_login_a=\'\'" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^svr_mode_b=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^svr_mode_b=" "${SETTINGS_NOW}"; then
         echo insert svr_mode_b and svr_login_b into ${SETTINGS_NOW}
         #echo ${sed} "\"/^svr_port_b=/a #ntrip B caster mode]\\nsvr_mode_b=\'0\'\\n#ntrip B caster login\\nsvr_login_b=\'\'\"" \"${SETTINGS_NOW}\"
         ${sed} "/^svr_port_b=/a #ntrip B caster mode\nsvr_mode_b=\'0\'\n#ntrip B caster login\nsvr_login_b=\'\'" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^\[ntrip_E\]=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^\[ntrip_E\]" "${SETTINGS_NOW}"; then
         echo insert [ntrip_E] into ${SETTINGS_NOW}
         ${sed} "/^ntrip_b_receiver_options=/a \ \n[ntrip_E]\n\n# NTRIP E caster options\n\n#ntrip E caster url\nsvr_addr_e=\'caster\.centipede\.fr\'\n#ntrip E caster port\nsvr_port_e=\'2101\'\n#ntrip E caster mode\nsvr_mode_e=\'2\'\n#ntrip E caster login\nsvr_login_e=\'\'\n#ntrip E caster password\nsvr_pwd_e=\'\'\n#Mount name\nmnt_name_e=\'Your_mount_name\'\nrtcm_msg_e=\'${rtcm_msg}\'\n#Receiver dependent options\nntrip_e_receiver_options=\'\'" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^\[ntrip_D\]=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^\[ntrip_D\]" "${SETTINGS_NOW}"; then
         echo insert [ntrip_D] into ${SETTINGS_NOW}
         ${sed} "/^ntrip_b_receiver_options=/a \ \n[ntrip_D]\n\n# NTRIP D caster options\n\n#ntrip D caster url\nsvr_addr_d=\'caster\.emlid\.com\'\n#ntrip D caster port\nsvr_port_d=\'2101\'\n#ntrip D caster mode\nsvr_mode_d=\'0\'\n#ntrip D caster login\nsvr_login_d=\'\'\n#ntrip D caster password\nsvr_pwd_d=\'\'\n#Mount name\nmnt_name_d=\'Your_mount_name\'\nrtcm_msg_d=\'${rtcm_msg}\'\n#Receiver dependent options\nntrip_d_receiver_options=\'\'" "${SETTINGS_NOW}"
      fi

      #echo if ! grep -q \"^\[ntrip_C\]=\" \"${SETTINGS_NOW}\"\; then
      if ! grep -q "^\[ntrip_C\]" "${SETTINGS_NOW}"; then
         echo insert [ntrip_C] into ${SETTINGS_NOW}
         ${sed} "/^ntrip_b_receiver_options=/a \ \n[ntrip_C]\n\n# NTRIP C caster options\n\n#ntrip C caster url\nsvr_addr_c=\'rtk2go\.com\'\n#ntrip C caster port\nsvr_port_c=\'2101\'\n#ntrip C caster mode\nsvr_mode_c=\'2\'\n#ntrip C caster login\nsvr_login_c=\'\'\n#ntrip C caster password\nsvr_pwd_c=\'\'\n#Mount name\nmnt_name_c=\'Your_mount_name\'\nrtcm_msg_c=\'${rtcm_msg}\'\n#Receiver dependent options\nntrip_c_receiver_options=\'\'" "${SETTINGS_NOW}"
      fi

   else
      #echo cp ${SETTINGS_DEFAULT} ${SETTINGS_NOW}
      cp ${SETTINGS_DEFAULT} ${SETTINGS_NOW}
      ExitCodeCheck $?

      #echo chown ${RTKBASE_USER}:${RTKBASE_USER} ${SETTINGS_NOW}
      chown ${RTKBASE_USER}:${RTKBASE_USER} ${SETTINGS_NOW}
      ExitCodeCheck $?

      ${sed} s/^position=.*/position=\'0\.00\ 0\.00\ 0\.00\'/ "${SETTINGS_NOW}"
      ${sed} s/^com_port=.*/com_port=\'\'/ "${SETTINGS_NOW}"
      ${sed} s/^com_port_settings=.*/com_port_settings=\'115200:8:n:1\'/ "${SETTINGS_NOW}"
      ${sed} s/^receiver=.*/receiver=\'\'/ "${SETTINGS_NOW}"
      ${sed} s/^receiver_format=.*/receiver_format=\'rtcm3\'/ "${SETTINGS_NOW}"
      ${sed} s/^antenna_info=.*/antenna_info=\'ELT0123\'/ "${SETTINGS_NOW}"

      ${sed} s/^svr_addr_a=.*/svr_addr_a=\'servers.onocoy.com\'/ "${SETTINGS_NOW}"
      ${sed} s/^svr_addr_b=.*/svr_addr_b=\'ntrip.rtkdirect.com\'/ "${SETTINGS_NOW}"

      ${sed} s/^rtcm_msg_a=.*/rtcm_msg_a=\'${rtcm_msg_onocoy}\'/ "${SETTINGS_NOW}"
      ${sed} s/^rtcm_msg_b=.*/rtcm_msg_b=\'${rtcm_msg}\'/ "${SETTINGS_NOW}"
      ${sed} s/^local_ntripc_msg=.*/local_ntripc_msg=\'${rtcm_msg}\'/ "${SETTINGS_NOW}"
      ${sed} s/^rtcm_svr_msg=.*/rtcm_svr_msg=\'${rtcm_msg_full}\'/ "${SETTINGS_NOW}"
      ${sed} s/^rtcm_serial_msg=.*/rtcm_serial_msg=\'${rtcm_msg_full}\'/ "${SETTINGS_NOW}"

      ${sed} s/^archive_rotate=.*/archive_rotate=\'20\'/ "${SETTINGS_NOW}"
   fi
}

configure_gnss(){
   if [[ "${UPDATE}" != "Y" ]] || ! have_full
   then
      UP_TIME=`cat /proc/uptime | sed "s/\..*$//"`
      LIMIT_TIME=40
      LEFT_TIME=`expr ${LIMIT_TIME} - ${UP_TIME}`
      #echo UP_TIME=${UP_TIME} LIMIT_TIME=${LIMIT_TIME} LEFT_TIME=${LEFT_TIME}
      if [[ ${LEFT_TIME} -gt 0 ]]; then
         #echo sleep ${LEFT_TIME}
         sleep ${LEFT_TIME}
      fi

      rtkbase_path=${RTKBASE_GIT}
      #echo source "${rtkbase_path}/tools/opizero_temp_offset.sh"
      source "${rtkbase_path}/tools/opizero_temp_offset.sh"
      ExitCodeCheck $?

      for i in `seq 1 3`; do
         #echo ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -c
         ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -e
         ExitCodeCheck $?
         if [[ $lastcode == 0 ]]; then
            break;
         fi
      done

      for i in `seq 1 3`; do
         #echo ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -c
         ${RTKBASE_TOOLS}/${UNICORE_CONFIGURE} -u ${RTKBASE_USER} -c
         ExitCodeCheck $?
         if [[ $lastcode == 0 ]]; then
            break;
         fi
      done

      restart_rtkbase_if_started
   fi
}

start_rtkbase_services(){
  #echo ${RTKBASE_TOOLS}/insall.sh -u ${RTKBASE_USER} -s
  ${RTKBASE_TOOLS}/install.sh -u ${RTKBASE_USER} -s
  ExitCodeCheck $?

  source <( grep '^receiver=' "${SETTINGS_NOW}" ) #import settings
  ExitCodeCheck $?
  #echo receiver=${receiver}

  GNSS_WEB_PROXY=rtkbase_gnss_web_proxy.service
  if [[ "${receiver}" =~ Septentrio ]]; then
     #echo systemctl enable --now "${GNSS_WEB_PROXY}"
     systemctl enable --now "${GNSS_WEB_PROXY}"
     ExitCodeCheck $?

     #echo systemctl enable --now "${DHCP_SERVICE}"
     systemctl enable --now "${DHCP_SERVICE}"
     ExitCodeCheck $?

     #echo systemctl enable --now "${SEPTENTRIO_NAT_SERVICE}"
     systemctl enable --now "${SEPTENTRIO_NAT_SERVICE}"
     ExitCodeCheck $?
  fi

  #echo systemctl start "${CHECK_INTERNET_SERVICE}"
  systemctl start "${CHECK_INTERNET_SERVICE}"
  ExitCodeCheck $?
}

delete_garbage(){
   if [[ "${FILES_DELETE}" != "" ]]
   then
      echo '################################'
      echo 'DELETE GARBAGE'
      echo '################################'

      #echo rm -f ${FILES_DELETE}
      rm -f ${FILES_DELETE}
      #echo \[ $exitcode = 0 \] \&\& have_receiver \&\& echo rm -f ${BASENAME}
   fi
   [ $exitcode = 0 ] && have_receiver && rm -f ${BASENAME}
}

info_open(){
   NOW_HOST=`hostname`
   if [ $exitcode = 0 ]
   then
      echo You can open your browser to http://${NOW_HOST}.local into local network
   else
      echo exitcode = $exitcode Check bugs in this output
   fi
}

info_bug(){
   if [ $exitcode != 0 ]
   then
      echo exitcode = $exitcode Check bugs in this output
   fi
}

HAVE_RECEIVER=0
HAVE_PHASE1=0
HAVE_FULL=0
CAN_REBOOT=0

have_receiver(){
   return ${HAVE_RECEIVER}
}
have_phase1(){
   return ${HAVE_PHASE1}
}
have_full(){
   return ${HAVE_FULL}
}
can_reboot(){
   return ${CAN_REBOOT}
}

BASE_EXTRACT="${NMEACONF} ${CONF980} ${CONF982} ${CONFBYNAV} ${UNICORE_CONFIGURE} \
              ${RUNCAST_PATCH} ${SET_BASE_POS} ${SETTINGS_CONF_PATCH} \
              ${RTKBASE_INSTALL} ${SYSCONGIG} ${SYSSERVICE} ${CONFIG_MANAGER_PATCH} \
              ${SERVER_PATCH} ${STATUS_PATCH} ${TUNE_POWER} ${CONFIG} \
              ${RTKLIB}/* ${SETTING_JS_PATCH} ${BASE_PATCH} \
              ${CONFSEPTENTRIO} ${TESTSEPTENTRIO} ${SETTING_HTML_PATCH} \
              ${PPP_CONF_PATCH} ${CONFIG_ORIG} ${TAILSCALE_GET_HREF} \
              ${SYSTEM_UPGRADE} ${EXEC_UPDATE} ${NETWORK_EVENT} \
              ${CHECK_INTERNET} ${CHECK_INTERNET_SERVICE} \
              ${SEPTENTRIO_NAT} ${SEPTENTRIO_NAT_SERVICE} \
              ${DHCP_CONF} ${DHCP_SERVICE} ${NTRIP_C} ${NTRIP_D} ${NTRIP_E}"
FILES_EXTRACT="${BASE_EXTRACT} uninstall.sh"
FILES_DELETE="${CONFIG} ${CONFIG_ORIG}"

check_phases(){
   if [[ ${1} == "-1" ]]
   then
      HAVE_RECEIVER=1
      HAVE_PHASE1=0
      HAVE_FULL=1
      FILES_EXTRACT="${BASE_EXTRACT}"
   elif [[ ${1} == "-2" ]]
   then
      HAVE_RECEIVER=0
      HAVE_PHASE1=1
      HAVE_FULL=1
      FILES_EXTRACT=
      FILES_DELETE=
   elif [[ ${1} == "-u" ]]
   then
      FILES_EXTRACT="${BASE_EXTRACT}"
   elif [[ ${1} == "-U" ]]
   then
      FILES_EXTRACT="${BASE_EXTRACT}"
      ONLINE_UPDATE=UPDATE
      CAN_REBOOT=1
   elif [[ ${1} == "-s" ]]
   then
      exit 0
   elif [[ ${1} != "" ]]
   then
      echo Invalid argument \"${1}\"
      exit 1
   fi

   #echo HAVE_RECEIVER=${HAVE_RECEIVER} HAVE_PHASE1=${HAVE_PHASE1} HAVE_FULL=${HAVE_FULL}
   #echo FILES_EXTRACT=${FILES_EXTRACT}
   #echo FILES_DELETE=${FILES_DELETE}
}

check_platform
restart_as_root ${1}
check_phases ${1}
have_phase1 && export LANG=C
unpack_files
have_phase1 && check_version
have_phase1 && check_boot_configiration
have_full && can_reboot && do_reboot
have_receiver && check_port
have_phase1 && install_tailscale
have_phase1 && install_additional_utilies
have_full || delete_pi_user
have_receiver && change_hostname ${HAVE_FULL}
stop_rtkbase_services
have_phase1 && add_rtkbase_user
have_phase1 && install_rtkbase_system_configure
have_phase1 && install_tune_power
#echo cd ${RTKBASE_PATH}
cd ${RTKBASE_PATH}
have_phase1 && install_rtklib
have_phase1 && copy_rtkbase_install_file
have_phase1 && rtkbase_install
have_phase1 && configure_for_unicore
have_phase1 && configure_settings
have_receiver && configure_gnss
have_receiver && start_rtkbase_services
#echo cd ${BASEDIR}
cd ${BASEDIR}
delete_garbage
cd ${ORIGDIR}
have_full || info_reboot
have_receiver && info_open
have_receiver || info_bug
can_reboot || do_reboot END
#echo exit $exitcode
exit $exitcode

